  false,\n\t\"url\": null,\n\t\"notes\": \"Bombay Hook National Wildlife Refuge was
  established for the preservation of the waterfowl resource. The refuge is still
  managed principally for the benefit of ducks and geese but is also managed to maintain
  and perpetuate a diversity of wildlife species and their habitats. Wildlife inventories
  provide data on the size, composition and reproduction of populations that are needed
  to appraise the success of management and development programs in attaining the
  wildlife goals. This report includes the plans, maps, estimated costs, sample summary
  sheets and procedures for census efforts for the refuge.\",\n\t\"license_title\":
